import my.component.GleanMetrics.CustomPingData class MyCustomPingScheduler { /** * HERE ONLY TO KEEP THE EXAMPLE SIMPLE. * * A function that consumes the Glean SDK generated metrics API to * record some data. It doesn't really need to be in a function, nor * in this class. The Glean SDK API can be called when the data is * generated. */ fun addSomeData() { // Record some sample data. CustomPingData.sampleString.set("test-data") } /** * Called to implement the ping scheduling logic for 'my_custom_ping'. */ fun schedulePing() { // ... some scheduling logic that will end up calling the function below. sendPing() } /** * Internal function to only be overriden in tests. This * calls the Glean SDK API to send custom pings. */ @VisibleForTesting(otherwise = VisibleForTesting.NONE) internal fun sendPing() { Pings.MyCustomPing.send() }
} Finally, here is a simple unit test that intercepts the MyCustomPingScheduler.schedulePing() call in order to perform the validation on the data. This specific example uses Mockito, but any other framework would work. // Metrics and pings definitions.
import my.component.GleanMetrics.Pings
import my.component.GleanMetrics.CustomPingData // Mockito imports for using spies.
import org.mockito.Mockito.spy
import org.mockito.Mockito.`when` @RunWith(AndroidJUnit4::class)
class MyCustomPingSchedulerTest { // Apply the GleanTestRule to set up a disposable Glean instance. // Please note that this clears the Glean data across tests. @get:Rule val gleanRule = GleanTestRule(ApplicationProvider.getApplicationContext()) @Test fun `verify custom ping metrics`() { val scheduler = spy(MyCustomPingScheduler()) doAnswer { // Here we validate the content that goes into the ping. assertTrue(CustomPingData.sampleString.testHasValue()) assertEquals("test-data", CustomPingData.sampleString.testGetValue()) // We want to intercept this call, but we also want to make sure the // real Glean API is called in order to clear the ping store and to provide // consistent behaviour with respect to the application. it.callRealMethod() }.`when`(scheduler).sendPing() scheduler.addSomeData() scheduler.schedulePing() }
