In order to prevent issues with async calls when unit testing Glean, it is important to put the Glean SDK into testing mode by applying the JUnit GleanTestRule to your test class. When the Glean SDK is in testing mode, it enables uploading and clears the recorded metrics at the beginning of each test run. The rule can be used as shown below: @RunWith(AndroidJUnit4::class)
class ActivityCollectingDataTest { // Apply the GleanTestRule to set up a disposable Glean instance. // Please note that this clears the Glean data across tests. @get:Rule val gleanRule = GleanTestRule(ApplicationProvider.getApplicationContext()) @Test fun checkCollectedData() { // The Glean SDK testing API can be called here. }
} This will ensure that metrics are done recording when the other test functions are used. To check if a value exists (i.e. it has been recorded), there is a testHasValue() function on each of the metric instances: assertTrue(GleanMetrics.Search.defaultSearchEngineUrl.testHasValue()) To check the actual values, there is a testGetValue() function on each of the metric instances. It is important to check that the values are recorded as expected, since many of the metric types may truncate or error-correct the value. This function will return a datatype appropriate to the specific type of the metric it is being used with: assertEquals("https://example.com/search?", GleanMetrics.Search.defaultSearchEngineUrl.testGetValue()) Note that each of these functions has its visibility limited to the scope of unit tests by making use of the @VisibleForTesting annotation, so the IDE should complain if you attempt to use them inside of client code.

