A Timing distribution is represented as an object with the following fields. Field name Type Description sum Integer The sum of all recorded values. values Map<String, Integer> The values in each bucket. The key is the minimum value for the range of that bucket. A contiguous range of buckets is always sent, so that the server can aggregate and visualize distributions, without knowing anything about the specific bucketing function used. This range starts with the first bucket with a non-zero accumulation, and ends at one bucket beyond the last bucket with a non-zero accumulation (so that the upper bound on the last bucket is retained). For example, the following shows the recorded values vs. what is sent in the payload. recorded: 1024: 2, 1116: 1, 1448: 1,
sent: 1024: 2, 1116: 1, 1217: 0, 1327: 0, 1448: 1, 1579: 0 Example: { "sum": 4612, "values": { "1024": 2, "1116": 1, "1217": 0, "1327": 0, "1448": 1, "1579": 0 }
}

